import React from 'react';
import { Bar } from 'react-chartjs-2';
import './App.css'; // Tuodaan CSS-tiedosto

function App() {
  const chartData = {
    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
    datasets: [
      {
        label: 'Example Data',
        data: [12, 19, 3, 5, 2, 3],
        backgroundColor: [
          'rgba(255, 99, 132, 0.6)',
          'rgba(54, 162, 235, 0.6)',
          'rgba(255, 206, 86, 0.6)',
          'rgba(75, 192, 192, 0.6)',
          'rgba(153, 102, 255, 0.6)',
          'rgba(255, 159, 64, 0.6)'
        ]
      }
    ]
  };

  return (
    <div className="App">
      <header className="App-header">
        Green house
        <div className="chart-container"> {/* Lisätään luokka */}
          <Bar
            data={chartData}
            options={{
              responsive: true,
              maintainAspectRatio: false
            }}
          />
        </div>
      </header>
    </div>
  );
}

export default App;
